    def ng():
        return (False, [])

    def ok(schedule):
        return (True, schedule)
    total = sum(ni)
    if W < 1 or total < W:
        return ng()
    if N == 1:
        if W == ni[0]:
            return ok([1] * (ni[0] * 2))
        else:
            return ng()
